response.about:
Ми пропонуємо три ключові етапи для досягнення поставленої мети:

2010 – 2015 рр. Перший етап реформ:
 конституційна реформа;
 судово-правова реформа;
 реформа державного управління;
 модернізація економіки;
 пенсійна реформа;
 реформа оплати праці;
 податкова реформа.

2015 – 2020 рр. Другий етап реформ:
 реформа місцевого самоврядування;
 упровадження концепції субрегіонів (утворених відповідно до спеціалізації та концентрації ресурсів);
 усунення диспропорцій між регіонами;
 побудова ефективних місцевих політик.

2020 – 2025 рр. Третій етап реформ: 
 участь України в розбудові нової посткризової глобальної системи (міжнародних інституціях та ініціативах);
 політика регіонального партнерства та інтеграції для посилення конкурентних переваг, створення можливостей для України в світовій економіці й політиці.

Якщо Ви бажаєте стати членом партії УДАР телефонуйте 0639387756
